description:
When two young couples venture into the desert for a sexy photo shoot, fun in the sun quickly turns to disaster after the car crashes into a ravine.

Dehydrated, lost and hopless, one by one the group falls victim to the relentless elements. Suffering from delirium and dying of thirst, will anyone make it out alive?
